What an honor to work with such inspiring women! 

@sherrijlovely is the founder of
@thegalentinesdaygala. We worked tirelessly over the past year to make this vision a reality for the second time. Instead of a single day, it was a weekend event that allowed successful businesswomen to celebrate, honor, and network with other female CEOs. 

It was an honor to design and organize the fully booked event in 2023. Can't wait to see how this event continues to evolve in the future. Photo by @alwaysushtx 

